(function () {
    return angular.module('viperLeaderBoardApp.leaderboardController')
    .controller('eventController', ['$scope', 'eventService', 'LeaderBoardLayoutService', '$location',
        function ($scope, eventService, LeaderBoardLayoutService, $location) {

            function loadEventList() {
                eventService.getTournamentList().then(function (data) {
                    if (data.data != undefined) {
                        $scope.eventList = data.data;
                        $scope.seletedEvent = "0";
                    }
                })
            }

            function loadEventListInIt() {
                eventService.getTournamentListLatest().then(function (data) {
                    if (data.data != undefined) {
                        $scope.eventList = data.data;
                        $scope.seletedEvent = "0";
                    }
                })
            }

            function loadLayoutList() {
                LeaderBoardLayoutService.getLayoutsActiveAll().then(function (data) {
                    if (data.data != undefined) {
                        $scope.layoutList = data.data;
                        $scope.seletedLayout = "0";
                    }
                })
            }

            function selectLayoutByTournamentID() {
                eventService.getLeaderBoardEventByTournamentID($scope.seletedEvent).then(function (data) {
                    if (data.data != undefined) {
                        $scope.seletedLayout = data.data.LayoutID;
                        $scope.Id = data.data.Id;
                    }
                    else {
                        $scope.seletedLayout = "0";
                        $scope.Id = 0;
                    }
                })
            }

            $scope.saveLeaderBoardEvent = function () {
                var leaderBoardEvent = { 'TournamentID': $scope.seletedEvent, 'LayoutID': $scope.seletedLayout, 'Id': $scope.Id }
                eventService.saveLeaderBoardEvent(leaderBoardEvent)
                    .success(function (data) {
                        $scope.Id = data.Id;
                        alertify.success("Saved Successfully");
                    })
                    .error(function (err) {
                        alertify.error("Error!");
                    });
            }

            function Init() {
                $scope.seletedEvent = 0;
                $scope.seletedLayout = 0;
                $scope.Id = 0;
            }

            //page load events...hp
            Init();
            loadEventListInIt();
            loadLayoutList();

            //event selection changed event..hp
            $scope.ddlEventSelection = function () {
                if ($scope.seletedEvent > 0) {
                    selectLayoutByTournamentID();
                }
                else {
                    $scope.seletedLayout = "0";
                    $scope.Id = 0;
                }
            }

            $scope.gotoLeaderBoard = function () {
                $location.url('/dashboard?id=' + $scope.seletedLayout + '&eventID=' + $scope.seletedEvent);
            }

            $scope.showAllEvents = function () {
                loadEventList();
            }
            
        }])
})();

