(function () {
   return angular.module('viperLeaderBoardApp.leaderboardController')
    .controller('homeController', ['$scope', '$window', 'services', '$location', '$modal', function ($scope, $window, services, $location, $modal) {
 
        function init() {
            $scope.parentObj = {};
            $scope.parentObj.draggableObject = []
            $scope.parentObj.LBLayouts = [];
            $scope.parentObj.divwidth = 100;
            $scope.parentObj.divheight = 100;
            $scope.parentObj.Draggable = "";
            $scope.parentObj.name = "";

            $scope.parentObj.textProperty = {};
            $scope.showModal = false;
        }

        function getAllLayout() {
            services.getLBLayouts().then(function (lbLayouts) {
                $scope.parentObj.LBLayouts = lbLayouts.data;
            })
        }

        init();
        getAllLayout();

        var index = 1;
        var divTop = 180;
        var divleft = 50;
        $scope.addDraggable = function () {
            if ($scope.parentObj.Draggable != null && $scope.parentObj.Draggable.trim() != '') {
                var insideObject = {};
                insideObject.text = $scope.parentObj.Draggable;
                insideObject.divtop = $scope.parentObj.draggableObject.length == 0 ? divTop : divTop * (Math.ceil($scope.parentObj.draggableObject.length / 5));
                insideObject.divleft = $scope.parentObj.draggableObject.length == 0 ? divleft : divleft + $scope.parentObj.draggableObject.length * 150;
                insideObject.divwidth = "100";
                insideObject.divheight = "100";
                insideObject.fontSize = "20px";
                insideObject.fontFamily = "Arial";
                insideObject.fontColor = "black";
                insideObject.fontStyle = "Normal";
                insideObject.backgroundColor = "transparent";
                insideObject.textAlign = "left";
                $scope.parentObj.draggableObject.push(insideObject);
                $scope.parentObj.Draggable = "";
            }
        };

        $scope.postData = function () {
            
            var divs = angular.element('.draggableDiv');
            var htmlValue = '';
            if (divs != null && divs.length > 0)
            {
                for (var index = 0 ; index < divs.length; index++) {
                    htmlValue += divs.get(index).outerHTML.trim();
                }
               


            }

            var data = { "value": JSON.stringify(htmlValue), "name": $scope.parentObj.name };
            services.postHtml(data).then(function (country) {
                var data = country;
                $scope.parentObj.name = "";
                getAllLayout();
                $scope.parentObj.draggableObject = [];
            });
        }

        $scope.openLayout = function (id) {
            $location.url('/leaderboardView?id=' + id);
        }

        $scope.deleteLayout = function (id) {

            for (var i = $scope.parentObj.LBLayouts.length - 1; i >= 0; i--) {
                if ($scope.parentObj.LBLayouts[i].id == id) {
                    $scope.parentObj.LBLayouts.splice(i, 1);
                    break;
                }
            }

        }

        $scope.toggleModal = function (text) {
            $scope.showModal = !$scope.showModal;
            $scope.elementName = text;

        };

       
        $scope.open = function (inside) {
            if (inside.isDragging)
                inside.isDragging = false;
            else {
                $scope.inside1 = inside;
                $modal.open({
                    templateUrl: 'app/partial/LeaderBoardTextPropPopUp.html',
                    backdrop: true,
                    windowClass: 'modal',
                    controller: function ($scope, $modalInstance, inside2) {
                        $scope.inside4 = inside2;
                       
                       // $("#bgColor").spectrum("set", inside2.backgroundColor);
                       
                    },
                    resolve: {
                        inside2: function () {
                            return $scope.inside1;
                        }
                    }
                });
            }
        };



        $scope.testClick = function (obj) {
            $scope.copyobj = obj;
            $scope.text = obj.text;
            $scope.fontSize = obj.fontSize;
            $scope.fontColor = obj.fontColor;
            $scope.fontFamily = obj.fontFamily;
            $scope.fontStyle = obj.fontStyle;

            $("#fontColor").spectrum("set", obj.fontColor);
        };


        $scope.$watch('fontSize', function (value) {
            if ($scope.copyobj != undefined)
                $scope.copyobj.fontSize = $scope.fontSize;
        });

        $scope.$watch('fontColor', function (value) {
            if ($scope.copyobj != undefined)
                $scope.copyobj.fontColor = $scope.fontColor;
        });

        $scope.$watch('fontFamily', function (value) {
            if ($scope.copyobj != undefined)
                $scope.copyobj.fontFamily = $scope.fontFamily;
        });

        $scope.$watch('fontStyle', function (value) {
            if ($scope.copyobj != undefined)
                $scope.copyobj.fontStyle = $scope.fontStyle;
        });

        $scope.$watch('backgroundColor', function (value) {
            if ($scope.copyobj != undefined)
                $scope.copyobj.backgroundColor = $scope.backgroundColor;
        });
    }])

})();

