(function () {
    return angular.module('viperLeaderBoardApp.leaderboardController')
    .controller('LeaderBoardLayoutController', ['$scope', 'LeaderBoardLayoutService','$location',
        function ($scope, LeaderBoardLayoutService, $location) {
            var siteID = localStorage.siteID;
            //initilization...
            function layoutInit() {
                $scope.layout = { 'LayoutName': '', 'LayoutDescription': '', 'Id': '', 'siteID': siteID };
            }
            
            $scope.gridOptions = {};
            $scope.gridOptions.columnDefs = [
            {
                name: 'LayoutName', displayName: "Template Name", width: "15%"
            },
            {
                name: 'LayoutDescription', displayName: "Template Description", width: "40%"
            },
            {
                name: 'Edit', width: "10%",
                cellTemplate: '<button class="btn btn-primary" style="width:80%" ng-click="grid.appScope.editLayout(row)">Edit</button>'
            },
            {
                name: 'Delete', width: "10%",
                cellTemplate: '<button class="btn btn-danger" style="width:80%" ng-click="grid.appScope.DeleteLayout(row)">Delete</button>'
            },
            {
                name: 'Action', width: "10%", field: 'IsActive',
                cellTemplate: '<button class="btn btn-warning" style="width:90%" ng-click="grid.appScope.DeactivateLayout(row)">{{ (MODEL_COL_FIELD==true)&& "DeActivate it" || "Activate it" }}</button>'
            },
            {
                name: 'Design', width: "10%",
                cellTemplate: '<button class="btn btn-danger" style="width:80%" ng-click="grid.appScope.DesignTemplate(row)">Design</button>'
            }];

            function loadLayoutsAll() {
                LeaderBoardLayoutService.getLayoutsAll().then(function (data) {
                    if (data.data != undefined)
                        $scope.gridOptions = { enableSorting: false, data: data.data };
                });
            }

            $scope.saveLayout = function () {
                LeaderBoardLayoutService.saveLayout($scope.layout)
                    .success(function (data) {
                        if ($scope.layout.Id > 0)
                            loadLayoutsAll();
                        else
                            $scope.gridOptions.data.push(data);

                        layoutInit();
                        alertify.success("Saved Successfully");
                    })
                    .error(function (a, b, c, d) {
                        loadLayoutsAll();
                        layoutInit();
                        alertify.error("Error!");
                    });
            }

            $scope.editLayout = function (row) {
                $scope.layout = angular.copy(row.entity);
            }

            $scope.DeleteLayout = function (row) {
                var index = $scope.gridOptions.data.indexOf(row.entity);
                $scope.gridOptions.data.splice(index, 1);

                LeaderBoardLayoutService.DeleteLayoutById(row.entity.Id)
                 .success(function () {
                     alertify.success("Deleted Successfully");
                 })
                error(function () {
                    alertify.error("Error!");
                });
            };

            $scope.DeactivateLayout = function (row) {
                var s = row;
                row.entity.IsActive = !row.entity.IsActive;
                LeaderBoardLayoutService.updateLayoutIsActive(row.entity.Id, row.entity.IsActive)
                 .success(function () {
                     alertify.success((row.entity.IsActive) ? "Activated Successful" : "Deactivated Successful");
                 })
                 .error(function () {
                     alertify.error("Error!");
                 });
            };

            $scope.DesignTemplate = function (row) {
                $location.url('/background?id=' + row.entity.Id )
            }
            layoutInit();
            loadLayoutsAll();

        }])
})();

