(function () {
    return angular.module('viperLeaderBoardApp.leaderboardController')
    .controller('LeaderBoardViewController', ['$scope', 'services', '$routeParams', '$location',
        function ($scope, services, $routeParams, $location) {

            function getAllLayout() {
                services.getLBLayoutById($routeParams.id).then(function (lbLayouts) {
                    $scope.html = lbLayouts.data.substring(1, lbLayouts.data.length - 1);
                })
            }

            getAllLayout();

            $scope.back = function () {
                $location.url('/leaderboardConfig');
            }

        }])
})();



